import React from "react";
import {
  Link,
  useLocation,
} from "react-router-dom";

export default class EntityView extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      entities: [],
    };
  }

  componentDidMount() {
    fetch("http://localhost/VSV/SAT/API/getEntity.php")
        .then((res) => res.json())
        .then(
            (result) => {
              this.setState({
                isLoaded: true,
                entity: result,
              });
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
              this.setState({
                isLoaded: true,
                error: "Error loading entity",
              });
            }
        );
  }

  render() {
    return (
      <h1> entity view </h1>
    );
  }
}
